script: |
  super -f text -I q11757.spq | sort > q11757.out

inputs:
  - name: q11757.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + col0 NOT BETWEEN col1 + + col1 AND col0 * - 5 + - ( - ( + 9 ) + - col1 * col0 );
  - name: tab2

outputs:
  - name: q11757.out
    data: |
      46	51	23
      64	77	40
      75	67	58
